const App = () => {
  return <BrowserRouter>
  <div>
    <Routes>
      <Route path='/' element={<Register />} />
      <Route path='/login' element={<Login />} />
      <Route path='/' element={<Register />} />
    </Routes>
  </div>
  </BrowserRouter>
}

export default App;
